import React, {useState} from 'react'
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel, ListGroup, Nav, Navbar, Container, NavDropdown} from 'react-bootstrap';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

export const Pdf = () => {
    const [embedUrl]=useState('https://drive.google.com/file/d/1UaCdUdUJPO_NW2Qvj2iJUgRQkV2V5aTZ/preview')
    return(
        <div className="Container">
            <h1>seso</h1>
            <iframe src={embedUrl} width="640" height="480" allow="autoplay"></iframe>
        </div>
    )
}

export default Pdf;
